INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60000, 190804, 1, "カリン", 0, 0, 1, 1, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60000, 0, 0, "", 1, 0, 1, 2, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60000, 0, 0, "", 1, 0, 1, 3, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60000, 0, 0, "", 1, 0, 2, 4, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60000, 0, 0, "", 2, 0, 1, 5, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60000, 0, 0, "", 2, 0, 1, 6, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60000, 0, 0, "", 2, 0, 2, 7, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60000, 0, 0, "", 3, 0, 1, 8, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60000, 0, 0, "", 3, 0, 1, 9, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60000, 0, 0, "", 3, 0, 1, 10, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60000, 0, 0, "", 3, 0, 1, 11, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60000, 0, 0, "", 3, 0, 2, 12, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60000, 0, 0, "", 4, 0, 1, 13, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60000, 0, 0, "", 4, 0, 1, 14, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60000, 0, 0, "", 4, 0, 1, 15, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60000, 0, 0, "", 4, 0, 1, 16, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60000, 0, 0, "", 4, 0, 2, 17, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60000, 190804, 2, "カリン", 0, 0, 0, 18, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60000, 190804, 3, "カリン", 0, 7, 0, 19, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 80001, 101201, 1, "ハツネ", 0, 1, 0, 20, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 80001, 101201, 2, "ハツネ", 0, 1, 0, 21, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 80001, 103801, 1, "シオリ", 0, 1, 0, 22, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "来年も、\n一緒にいられたら…\nうれしいな", 80001, 103801, 2, "シオリ", 0, 1, 0, 23, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 80001, 103601, 1, "キョウカ", 0, 2, 0, 24, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 80001, 103601, 2, "キョウカ", 0, 2, 0, 25, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "おにいちゃんとあってから、\n1年たったよ～！", 80001, 102001, 1, "ミミ", 0, 2, 0, 26, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 80001, 102001, 2, "ミミ", 0, 2, 0, 27, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 80001, 100401, 1, "ミソギ", 0, 2, 0, 28, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 80001, 100401, 2, "ミソギ", 0, 2, 0, 29, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 80001, 101001, 1, "マホ", 0, 3, 0, 30, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 80001, 101001, 2, "マホ", 0, 3, 0, 31, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 80001, 104401, 1, "イリヤ", 0, 3, 0, 32, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 80001, 104401, 2, "イリヤ", 0, 3, 0, 33, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 80001, 101701, 1, "カオリ", 0, 3, 0, 34, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "これからも、どうぞよろしく\nお願いするさ～！", 80001, 101701, 2, "カオリ", 0, 3, 0, 35, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あんたと出会ってからもうそんなに\nたつのね～", 80001, 102801, 1, "サレン", 0, 4, 0, 36, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 80001, 102801, 2, "サレン", 0, 4, 0, 37, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 80001, 102501, 1, "スズメ", 0, 4, 0, 38, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 80001, 102501, 2, "スズメ", 0, 4, 0, 39, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 80001, 104601, 1, "タマキ", 0, 5, 0, 40, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 80001, 104601, 2, "タマキ", 0, 5, 0, 41, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 80001, 104801, 1, "ミフユ", 0, 5, 0, 42, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 80001, 104801, 2, "ミフユ", 0, 5, 0, 43, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あなたさまと出会ってもう1年…", 80001, 103201, 1, "アキノ", 0, 6, 0, 44, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 80001, 103201, 2, "アキノ", 0, 6, 0, 45, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 80001, 103401, 1, "ユカリ", 0, 6, 0, 46, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 80001, 103401, 2, "ユカリ", 0, 6, 0, 47, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 80001, 107101, 1, "クリスティーナ", 0, 7, 0, 48, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ともかくこれからも\n愉しませてくれよ☆", 80001, 107101, 2, "クリスティーナ", 0, 7, 0, 49, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 80001, 104701, 1, "ジュン", 0, 7, 0, 50, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "見えないから分からないって？\nそれもそうだな…", 80001, 104701, 2, "ジュン", 0, 7, 0, 51, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 80001, 103701, 1, "トモ", 0, 8, 0, 52, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これからもよろしくね！", 80001, 103701, 2, "トモ", 0, 8, 0, 53, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 80001, 100501, 1, "マツリ", 0, 8, 0, 54, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 80001, 100501, 2, "マツリ", 0, 8, 0, 55, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 80001, 100701, 1, "ミヤコ", 0, 9, 0, 56, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 80001, 100701, 2, "ミヤコ", 0, 9, 0, 57, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 80001, 103101, 1, "シノブ", 0, 9, 0, 58, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 80001, 103101, 2, "シノブ", 0, 9, 0, 59, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 80001, 100901, 1, "アンナ", 0, 10, 0, 60, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 80001, 100901, 2, "アンナ", 0, 10, 0, 61, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "君と出会ってもう1年だって！\n早いねー！", 80001, 101301, 1, "ナナカ", 0, 10, 0, 62, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 80001, 101301, 2, "ナナカ", 0, 10, 0, 63, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 80001, 105101, 1, "ミツキ", 0, 11, 0, 64, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これからも、いろんなところを\n調べさせてね？", 80001, 105101, 2, "ミツキ", 0, 11, 0, 65, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 80001, 105601, 1, "ルカ", 0, 11, 0, 66, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 80001, 105601, 2, "ルカ", 0, 11, 0, 67, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "早いものですわね、あなた様と\nお会いして、もう1年…", 80001, 102701, 1, "エリコ", 0, 11, 0, 68, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 80001, 102701, 2, "エリコ", 0, 11, 0, 69, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 80001, 102301, 1, "アヤネ", 0, 12, 0, 70, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 80001, 102301, 2, "アヤネ", 0, 12, 0, 71, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 80001, 104201, 1, "チカ", 0, 12, 0, 72, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "私のことを見守ってください\nできることなら、ずっと…", 80001, 104201, 2, "チカ", 0, 12, 0, 73, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 80001, 102101, 1, "クルミ", 0, 12, 0, 74, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 80001, 102101, 2, "クルミ", 0, 12, 0, 75, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 80001, 104901, 1, "シズル", 0, 13, 0, 76, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 80001, 104901, 2, "シズル", 0, 13, 0, 77, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 80001, 101101, 1, "リノ", 0, 13, 0, 78, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 80001, 101101, 2, "リノ", 0, 13, 0, 79, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80001, 100201, 1, "ユイ", 0, 14, 0, 80, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 80001, 100201, 2, "ユイ", 0, 14, 0, 81, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 80001, 100101, 1, "ヒヨリ", 0, 14, 0, 82, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 80001, 100101, 2, "ヒヨリ", 0, 14, 0, 83, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 80001, 100301, 1, "レイ", 0, 14, 0, 84, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "キミに背中を預けられる日が、\n早くきますように", 80001, 100301, 2, "レイ", 0, 14, 0, 85, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 80001, 105801, 1, "ペコリーヌ", 0, 15, 0, 86, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これからもずっと、覚えていて\nくださいね！", 80001, 105801, 2, "ペコリーヌ", 0, 15, 0, 87, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 80001, 105901, 1, "コッコロ", 0, 15, 0, 88, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 80001, 105901, 2, "コッコロ", 0, 15, 0, 89, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 80001, 106001, 1, "キャル", 0, 15, 0, 90, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 80001, 106001, 2, "キャル", 0, 15, 0, 91, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 60001, 112101, 1, "スズメ", 0, 0, 1, 92, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60001, 0, 0, "", 1, 0, 1, 93, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60001, 0, 0, "", 1, 0, 1, 94, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60001, 0, 0, "", 1, 0, 1, 95, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60001, 0, 0, "", 1, 0, 1, 96, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60001, 0, 0, "", 1, 0, 2, 97, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60001, 0, 0, "", 2, 0, 1, 98, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60001, 0, 0, "", 2, 0, 1, 99, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60001, 0, 0, "", 2, 0, 1, 100, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60001, 0, 0, "", 2, 0, 1, 101, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60001, 0, 0, "", 2, 0, 2, 102, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60001, 0, 0, "", 3, 0, 1, 103, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60001, 0, 0, "", 3, 0, 1, 104, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60001, 0, 0, "", 3, 0, 1, 105, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60001, 0, 0, "", 3, 0, 1, 106, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 60001, 0, 0, "", 3, 0, 1, 107, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 60001, 0, 0, "", 3, 0, 1, 108, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60001, 0, 0, "", 3, 0, 2, 109, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60001, 0, 0, "", 4, 0, 1, 110, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60001, 0, 0, "", 4, 0, 1, 111, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60001, 0, 0, "", 4, 0, 1, 112, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60001, 0, 0, "", 4, 0, 1, 113, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60001, 0, 0, "", 4, 0, 1, 114, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 60001, 0, 0, "", 4, 0, 1, 115, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60001, 0, 0, "", 4, 0, 2, 116, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 60001, 112101, 2, "スズメ", 0, 0, 0, 117, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 60001, 112101, 3, "スズメ", 0, 7, 0, 118, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 80003, 105801, 1, "ペコリーヌ", 0, 1, 0, 119, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 80003, 105901, 1, "コッコロ", 0, 1, 0, 120, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 80003, 105901, 2, "コッコロ", 0, 1, 0, 121, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "え？　ちょっと\nいきなりなにっ？", 80003, 106001, 1, "キャル", 0, 1, 0, 122, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 80003, 106001, 2, "キャル", 0, 1, 0, 123, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 80003, 105801, 2, "ペコリーヌ", 0, 1, 0, 124, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 80003, 105801, 3, "ペコリーヌ", 0, 1, 0, 125, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 80003, 105901, 3, "コッコロ", 0, 1, 0, 126, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 80003, 106001, 3, "キャル", 0, 1, 0, 127, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 80003, 105901, 4, "コッコロ", 0, 1, 0, 128, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 80003, 105801, 4, "ペコリーヌ", 0, 1, 0, 129, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 80003, 106001, 4, "キャル", 0, 1, 0, 130, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 80003, 105901, 5, "コッコロ", 0, 1, 0, 131, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 80003, 106001, 5, "キャル", 0, 2, 0, 132, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 80003, 190801, 1, "カリン", 0, 2, 0, 133, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "げっ…カリンじゃない\nなんでもないわよ！", 80003, 106001, 6, "キャル", 0, 2, 0, 134, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 80003, 190801, 2, "カリン", 0, 2, 0, 135, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 80003, 106001, 7, "キャル", 0, 2, 0, 136, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 80003, 190801, 3, "カリン", 0, 2, 0, 137, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 80003, 106001, 8, "キャル", 0, 2, 0, 138, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 80003, 106001, 9, "キャル", 0, 2, 0, 139, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 80003, 190801, 4, "カリン", 0, 2, 0, 140, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 80003, 106001, 10, "キャル", 0, 2, 0, 141, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 80003, 190801, 5, "カリン", 0, 2, 0, 142, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 80003, 106001, 11, "キャル", 0, 2, 0, 143, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 80003, 105901, 6, "コッコロ", 0, 3, 0, 144, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 80003, 105801, 5, "ペコリーヌ", 0, 3, 0, 145, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 80003, 105901, 7, "コッコロ", 0, 3, 0, 146, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 80003, 105901, 8, "コッコロ", 0, 3, 0, 147, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 80003, 105801, 6, "ペコリーヌ", 0, 3, 0, 148, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 80003, 105801, 7, "ペコリーヌ", 0, 3, 0, 149, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 80003, 105901, 9, "コッコロ", 0, 3, 0, 150, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 80003, 105801, 8, "ペコリーヌ", 0, 3, 0, 151, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 80003, 105901, 10, "コッコロ", 0, 3, 0, 152, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "えへへ、ありがとうございます\nコッコロちゃん！", 80003, 105801, 9, "ペコリーヌ", 0, 3, 0, 153, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 80003, 105901, 11, "コッコロ", 0, 3, 0, 154, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 80003, 105801, 10, "ペコリーヌ", 0, 3, 0, 155, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 80003, 105801, 11, "ペコリーヌ", 0, 4, 0, 156, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 80003, 106001, 12, "キャル", 0, 4, 0, 157, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 80003, 105801, 12, "ペコリーヌ", 0, 4, 0, 158, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 80003, 106001, 13, "キャル", 0, 4, 0, 159, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 80003, 105801, 13, "ペコリーヌ", 0, 4, 0, 160, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "…積極的？\nなんの話よ？", 80003, 106001, 14, "キャル", 0, 4, 0, 161, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 80003, 105801, 14, "ペコリーヌ", 0, 4, 0, 162, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 80003, 105801, 15, "ペコリーヌ", 0, 4, 0, 163, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 80003, 106001, 15, "キャル", 0, 4, 0, 164, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 80003, 105801, 16, "ペコリーヌ", 0, 4, 0, 165, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 80003, 106001, 16, "キャル", 0, 4, 0, 166, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 80003, 106001, 17, "キャル", 0, 4, 0, 167, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 80003, 106001, 18, "キャル", 0, 5, 0, 168, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 80003, 105901, 12, "コッコロ", 0, 5, 0, 169, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 80003, 106001, 19, "キャル", 0, 5, 0, 170, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 80003, 105901, 13, "コッコロ", 0, 5, 0, 171, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 80003, 106001, 20, "キャル", 0, 5, 0, 172, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 80003, 105901, 14, "コッコロ", 0, 5, 0, 173, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 80003, 106001, 21, "キャル", 0, 5, 0, 174, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 80003, 105901, 15, "コッコロ", 0, 5, 0, 175, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "かくし芸？", 80003, 106001, 22, "キャル", 0, 5, 0, 176, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 80003, 105901, 16, "コッコロ", 0, 5, 0, 177, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 80003, 106001, 23, "キャル", 0, 5, 0, 178, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 80003, 105801, 17, "ペコリーヌ", 0, 6, 0, 179, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 80003, 106001, 24, "キャル", 0, 6, 0, 180, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 80003, 105901, 17, "コッコロ", 0, 6, 0, 181, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 80003, 105801, 18, "ペコリーヌ", 0, 6, 0, 182, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 80003, 106001, 25, "キャル", 0, 6, 0, 183, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 80003, 105901, 18, "コッコロ", 0, 6, 0, 184, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 80003, 106001, 26, "キャル", 0, 6, 0, 185, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 80003, 106001, 27, "キャル", 0, 6, 0, 186, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 80003, 106001, 28, "キャル", 0, 6, 0, 187, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 80003, 105801, 19, "ペコリーヌ", 0, 6, 0, 188, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 80003, 105901, 19, "コッコロ", 0, 6, 0, 189, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 80003, 106001, 29, "キャル", 0, 6, 0, 190, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 80003, 106001, 30, "キャル", 0, 7, 0, 191, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 80003, 106001, 31, "キャル", 0, 7, 0, 192, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 80003, 106001, 32, "キャル", 0, 7, 0, 193, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あー\nあー\n…声、これで大丈夫かしら？", 80003, 106001, 33, "キャル", 0, 7, 0, 194, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 80003, 106001, 34, "キャル", 0, 7, 0, 195, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆", 80003, 106001, 35, "キャル", 0, 7, 0, 196, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 80003, 106001, 36, "キャル", 0, 7, 0, 197, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 80003, 106001, 37, "キャル", 0, 7, 0, 198, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 80003, 106001, 38, "キャル", 0, 7, 0, 199, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 80003, 105901, 20, "コッコロ", 0, 8, 0, 200, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 80003, 105901, 21, "コッコロ", 0, 8, 0, 201, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 80003, 105901, 22, "コッコロ", 0, 8, 0, 202, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 80003, 105901, 23, "コッコロ", 0, 8, 0, 203, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 80003, 105901, 24, "コッコロ", 0, 8, 0, 204, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆", 80003, 105901, 25, "コッコロ", 0, 8, 0, 205, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 80003, 105901, 26, "コッコロ", 0, 8, 0, 206, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 80003, 105901, 27, "コッコロ", 0, 8, 0, 207, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 80003, 105901, 28, "コッコロ", 0, 8, 0, 208, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆", 80003, 105801, 20, "ペコリーヌ", 0, 9, 0, 209, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 80003, 105801, 21, "ペコリーヌ", 0, 9, 0, 210, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あと６日で2.5周年ですか…", 80003, 105801, 22, "ペコリーヌ", 0, 9, 0, 211, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 80003, 105801, 23, "ペコリーヌ", 0, 9, 0, 212, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 80003, 105801, 24, "ペコリーヌ", 0, 9, 0, 213, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆", 80003, 105801, 25, "ペコリーヌ", 0, 9, 0, 214, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 80003, 105801, 26, "ペコリーヌ", 0, 9, 0, 215, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 80003, 105801, 27, "ペコリーヌ", 0, 9, 0, 216, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 80003, 105801, 28, "ペコリーヌ", 0, 9, 0, 217, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 80003, 105801, 29, "ペコリーヌ", 0, 9, 0, 218, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 80003, 105801, 30, "ペコリーヌ", 0, 9, 0, 219, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 80003, 105801, 31, "ペコリーヌ", 0, 10, 0, 220, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 80003, 105901, 29, "コッコロ", 0, 10, 0, 221, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 80003, 105801, 32, "ペコリーヌ", 0, 10, 0, 222, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "…………", 80003, 106001, 39, "キャル", 0, 10, 0, 223, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 80003, 105901, 30, "コッコロ", 0, 10, 0, 224, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 80003, 106001, 40, "キャル", 0, 10, 0, 225, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 80003, 105801, 33, "ペコリーヌ", 0, 10, 0, 226, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 80003, 106001, 41, "キャル", 0, 10, 0, 227, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 80003, 105801, 34, "ペコリーヌ", 0, 10, 0, 228, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 80003, 105801, 35, "ペコリーヌ", 0, 10, 0, 229, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 80003, 106001, 42, "キャル", 0, 10, 0, 230, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 80003, 105901, 31, "コッコロ", 0, 10, 0, 231, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 80003, 106001, 43, "キャル", 0, 10, 0, 232, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 80003, 105801, 36, "ペコリーヌ", 0, 10, 0, 233, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 80003, 190801, 6, "カリン", 0, 11, 0, 234, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 80003, 190801, 7, "カリン", 0, 11, 0, 235, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 80003, 190801, 8, "カリン", 0, 11, 0, 236, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 80003, 190801, 9, "カリン", 0, 11, 0, 237, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 80003, 190801, 10, "カリン", 0, 11, 0, 238, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 80003, 190801, 11, "カリン", 0, 11, 0, 239, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 80003, 190801, 12, "カリン", 0, 11, 0, 240, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 80003, 190801, 13, "カリン", 0, 11, 0, 241, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あれ？\nもしかして緊張で気を失って…？", 80003, 190801, 14, "カリン", 0, 11, 0, 242, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 80003, 190801, 15, "カリン", 0, 11, 0, 243, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 80003, 190801, 16, "カリン", 0, 11, 0, 244, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それでは\nまた明日お会いしましょう♪", 80003, 190801, 17, "カリン", 0, 11, 0, 245, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 80003, 106001, 44, "キャル", 0, 12, 0, 246, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 80003, 105801, 37, "ペコリーヌ", 0, 12, 0, 247, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 80003, 105901, 32, "コッコロ", 0, 12, 0, 248, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 80003, 106001, 45, "キャル", 0, 12, 0, 249, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ひどいですよぉキャルちゃ～ん！", 80003, 105801, 38, "ペコリーヌ", 0, 12, 0, 250, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 80003, 105901, 33, "コッコロ", 0, 12, 0, 251, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 80003, 105801, 39, "ペコリーヌ", 0, 12, 0, 252, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 80003, 106001, 46, "キャル", 0, 12, 0, 253, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 80003, 105901, 34, "コッコロ", 0, 12, 0, 254, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 80003, 105801, 40, "ペコリーヌ", 0, 12, 0, 255, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 80003, 105801, 41, "ペコリーヌ", 0, 13, 0, 256, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 80003, 106001, 47, "キャル", 0, 13, 0, 257, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "忘れてきちゃいました☆", 80003, 105801, 42, "ペコリーヌ", 0, 13, 0, 258, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 80003, 106001, 48, "キャル", 0, 13, 0, 259, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 80003, 105901, 35, "コッコロ", 0, 13, 0, 260, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 80003, 106001, 49, "キャル", 0, 13, 0, 261, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 80003, 105801, 43, "ペコリーヌ", 0, 13, 0, 262, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 80003, 106001, 50, "キャル", 0, 13, 0, 263, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 80003, 105901, 36, "コッコロ", 0, 13, 0, 264, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 80003, 106001, 51, "キャル", 0, 13, 0, 265, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 80003, 105901, 37, "コッコロ", 0, 13, 0, 266, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 80003, 106001, 52, "キャル", 0, 13, 0, 267, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 80003, 105801, 44, "ペコリーヌ", 0, 13, 0, 268, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 80003, 105901, 38, "コッコロ", 0, 13, 0, 269, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 80003, 105801, 45, "ペコリーヌ", 0, 13, 0, 270, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 80003, 106001, 53, "キャル", 0, 13, 0, 271, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 80003, 105801, 46, "ペコリーヌ", 0, 13, 0, 272, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "こんにちは\n【ギルド管理協会】のカリンです", 80003, 190801, 18, "カリン", 0, 14, 0, 273, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "昨日の生放送は\nいかがだったでしょうか？", 80003, 190801, 19, "カリン", 0, 14, 0, 274, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 80003, 190801, 20, "カリン", 0, 14, 0, 275, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 80003, 190801, 21, "カリン", 0, 14, 0, 276, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 80003, 190801, 22, "カリン", 0, 14, 0, 277, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 80003, 190801, 23, "カリン", 0, 14, 0, 278, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 80003, 190801, 24, "カリン", 0, 14, 0, 279, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 80003, 190801, 25, "カリン", 0, 14, 0, 280, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 80003, 190801, 26, "カリン", 0, 14, 0, 281, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 80003, 190801, 27, "カリン", 0, 14, 0, 282, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "準備はいいですかっ？\n…いっきますよー！", 80003, 105801, 47, "ペコリーヌ", 0, 15, 0, 283, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "祝！", 80003, 106001, 54, "キャル", 0, 15, 0, 284, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "2.5周年！", 80003, 105901, 39, "コッコロ", 0, 15, 0, 285, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "おめでとうございま～す☆", 80003, 105801, 48, "ペコリーヌ", 0, 15, 0, 286, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 80003, 106001, 55, "キャル", 0, 15, 0, 287, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 80003, 105901, 40, "コッコロ", 0, 15, 0, 288, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 80003, 105801, 49, "ペコリーヌ", 0, 15, 0, 289, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 80003, 106001, 56, "キャル", 0, 15, 0, 290, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 80003, 105901, 41, "コッコロ", 0, 15, 0, 291, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 80003, 106001, 57, "キャル", 0, 15, 0, 292, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 80003, 105801, 50, "ペコリーヌ", 0, 15, 0, 293, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 80003, 106001, 58, "キャル", 0, 15, 0, 294, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "記念日だから\n平気平気♪\nやばいですね☆", 80003, 105801, 51, "ペコリーヌ", 0, 15, 0, 295, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "意味分かんないわよ！", 80003, 106001, 59, "キャル", 0, 15, 0, 296, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 80003, 105901, 42, "コッコロ", 0, 15, 0, 297, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 80003, 105901, 43, "コッコロ", 0, 15, 0, 298, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 80003, 105801, 52, "ペコリーヌ", 0, 15, 0, 299, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 80003, 106001, 60, "キャル", 0, 15, 0, 300, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 80003, 105901, 44, "コッコロ", 0, 15, 0, 301, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 80003, 105801, 53, "ペコリーヌ", 0, 15, 0, 302, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 0, "2.5周年\nありがとうございます！", 80003, 105801, 54, "ペコリーヌ・コッコロ・キャル", 0, 15, 0, 303, "105901,45,106001,61");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60002, 190804, 1, "カリン", 0, 0, 1, 304, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60002, 0, 0, "", 1, 0, 1, 305, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60002, 0, 0, "", 1, 0, 1, 306, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60002, 0, 0, "", 1, 0, 1, 307, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60002, 0, 0, "", 1, 0, 1, 308, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60002, 0, 0, "", 1, 0, 2, 309, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60002, 0, 0, "", 2, 0, 1, 310, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60002, 0, 0, "", 2, 0, 1, 311, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60002, 0, 0, "", 2, 0, 1, 312, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60002, 0, 0, "", 2, 0, 1, 313, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60002, 0, 0, "", 2, 0, 2, 314, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60002, 0, 0, "", 3, 0, 1, 315, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60002, 0, 0, "", 3, 0, 1, 316, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60002, 0, 0, "", 3, 0, 1, 317, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60002, 0, 0, "", 3, 0, 1, 318, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 60002, 0, 0, "", 3, 0, 1, 319, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60002, 0, 0, "", 3, 0, 1, 320, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 60002, 0, 0, "", 3, 0, 2, 321, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60002, 0, 0, "", 4, 0, 1, 322, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 60002, 0, 0, "", 4, 0, 1, 323, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 60002, 0, 0, "", 4, 0, 1, 324, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60002, 0, 0, "", 4, 0, 1, 325, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60002, 0, 0, "", 4, 0, 1, 326, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 60002, 0, 0, "", 4, 0, 1, 327, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60002, 0, 0, "", 4, 0, 2, 328, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60002, 190804, 2, "カリン", 0, 0, 0, 329, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60002, 190804, 3, "カリン", 0, 7, 0, 330, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "ささ、シェフィさまはこちらへ…", 80005, 105901, 1, "コッコロ", 0, 1, 0, 331, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "コッコロさん、どこへ行くの…？\n…え？", 80005, 106401, 1, "シェフィ", 0, 1, 0, 332, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 80005, 105801, 1, "ペコリーヌ", 0, 1, 0, 333, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 80005, 105901, 2, "コッコロ", 0, 1, 0, 334, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ええと…\n二人とも何をしているの？", 80005, 106401, 2, "シェフィ", 0, 1, 0, 335, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 80005, 106001, 1, "キャル", 0, 1, 0, 336, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あの日…？", 80005, 106401, 3, "シェフィ", 0, 1, 0, 337, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 80005, 105801, 2, "ペコリーヌ", 0, 1, 0, 338, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 80005, 105801, 3, "ペコリーヌ", 0, 1, 0, 339, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "やばいですね☆", 80005, 190801, 1, "カリン", 0, 1, 0, 340, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "って、なにしれっと\n参加してんのよカリン！", 80005, 106001, 2, "キャル", 0, 1, 0, 341, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 80005, 190801, 2, "カリン", 0, 1, 0, 342, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 80005, 190801, 3, "カリン", 0, 1, 0, 343, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 80005, 105801, 4, "ペコリーヌ", 0, 1, 0, 344, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 80005, 106401, 4, "シェフィ", 0, 1, 0, 345, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 80005, 105801, 5, "ペコリーヌ", 0, 2, 0, 346, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 80005, 105901, 3, "コッコロ", 0, 2, 0, 347, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 80005, 105901, 4, "コッコロ", 0, 2, 0, 348, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 80005, 105801, 6, "ペコリーヌ", 0, 2, 0, 349, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "さすがでございます\nペコリーヌさま", 80005, 105901, 5, "コッコロ", 0, 2, 0, 350, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 80005, 106001, 3, "キャル", 0, 2, 0, 351, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 80005, 106401, 5, "シェフィ", 0, 2, 0, 352, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 80005, 105801, 7, "ペコリーヌ", 0, 2, 0, 353, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "さ、次はキャルさまの\n番でございますよ", 80005, 105901, 6, "コッコロ", 0, 2, 0, 354, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 80005, 106001, 4, "キャル", 0, 2, 0, 355, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 80005, 106401, 6, "シェフィ", 0, 2, 0, 356, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 80005, 106001, 5, "キャル", 0, 2, 0, 357, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 80005, 106001, 6, "キャル", 0, 2, 0, 358, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 80005, 105901, 7, "コッコロ", 0, 2, 0, 359, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 80005, 106001, 7, "キャル", 0, 2, 0, 360, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 80005, 105901, 8, "コッコロ", 0, 3, 0, 361, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 80005, 105801, 8, "ペコリーヌ", 0, 3, 0, 362, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 80005, 105901, 9, "コッコロ", 0, 3, 0, 363, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "聖学祭…って、なにかしら？", 80005, 106401, 7, "シェフィ", 0, 3, 0, 364, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 80005, 105901, 10, "コッコロ", 0, 3, 0, 365, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 80005, 106001, 8, "キャル", 0, 3, 0, 366, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 80005, 106001, 9, "キャル", 0, 3, 0, 367, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 80005, 105801, 9, "ペコリーヌ", 0, 3, 0, 368, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "いや、そのまんますぎでしょ…", 80005, 106001, 10, "キャル", 0, 3, 0, 369, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 80005, 106401, 8, "シェフィ", 0, 3, 0, 370, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 80005, 105801, 10, "ペコリーヌ", 0, 3, 0, 371, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "えっ？　ええ…\nぎゅーっ…？", 80005, 106401, 9, "シェフィ", 0, 3, 0, 372, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 80005, 106001, 11, "キャル", 0, 4, 0, 373, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 80005, 106401, 10, "シェフィ", 0, 4, 0, 374, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 80005, 106001, 12, "キャル", 0, 4, 0, 375, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 80005, 105901, 11, "コッコロ", 0, 4, 0, 376, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 80005, 106001, 13, "キャル", 0, 4, 0, 377, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 80005, 105801, 11, "ペコリーヌ", 0, 4, 0, 378, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 80005, 106001, 14, "キャル", 0, 4, 0, 379, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 80005, 106001, 15, "キャル", 0, 4, 0, 380, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 80005, 106401, 11, "シェフィ", 0, 4, 0, 381, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 80005, 105801, 12, "ペコリーヌ", 0, 4, 0, 382, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 80005, 105901, 12, "コッコロ", 0, 4, 0, 383, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 80005, 106001, 16, "キャル", 0, 4, 0, 384, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 80005, 106401, 12, "シェフィ", 0, 4, 0, 385, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 80005, 105801, 13, "ペコリーヌ", 0, 5, 0, 386, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 80005, 105801, 14, "ペコリーヌ", 0, 5, 0, 387, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 80005, 105801, 15, "ペコリーヌ", 0, 5, 0, 388, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 80005, 106001, 17, "キャル", 0, 5, 0, 389, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 80005, 106001, 18, "キャル", 0, 5, 0, 390, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 80005, 106401, 13, "シェフィ", 0, 5, 0, 391, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 80005, 105901, 13, "コッコロ", 0, 5, 0, 392, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 80005, 105801, 16, "ペコリーヌ", 0, 5, 0, 393, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 80005, 106001, 19, "キャル", 0, 5, 0, 394, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 80005, 105801, 17, "ペコリーヌ", 0, 5, 0, 395, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 80005, 105801, 18, "ペコリーヌ", 0, 5, 0, 396, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 80005, 105801, 19, "ペコリーヌ", 0, 5, 0, 397, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 80005, 190801, 4, "カリン", 0, 6, 0, 398, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 80005, 190801, 5, "カリン", 0, 6, 0, 399, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "…えっ！？", 80005, 106001, 20, "キャル", 0, 6, 0, 400, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 80005, 105801, 20, "ペコリーヌ", 0, 6, 0, 401, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 80005, 106401, 14, "シェフィ", 0, 6, 0, 402, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 80005, 105901, 14, "コッコロ", 0, 6, 0, 403, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 80005, 106401, 15, "シェフィ", 0, 6, 0, 404, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 80005, 106001, 21, "キャル", 0, 6, 0, 405, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 80005, 105801, 21, "ペコリーヌ", 0, 6, 0, 406, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ぶっ殺すぞ！？", 80005, 106001, 22, "キャル", 0, 6, 0, 407, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 80005, 190801, 6, "カリン", 0, 6, 0, 408, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 80005, 105901, 15, "コッコロ", 0, 7, 0, 409, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 80005, 106001, 23, "キャル", 0, 7, 0, 410, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 80005, 106401, 16, "シェフィ", 0, 7, 0, 411, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 80005, 105801, 22, "ペコリーヌ", 0, 7, 0, 412, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 80005, 106001, 24, "キャル", 0, 7, 0, 413, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 80005, 106401, 17, "シェフィ", 0, 7, 0, 414, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 80005, 105901, 16, "コッコロ", 0, 7, 0, 415, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 80005, 106401, 18, "シェフィ", 0, 7, 0, 416, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "もちろんでございます\n仲良くお勉強いたしましょう", 80005, 105901, 17, "コッコロ", 0, 7, 0, 417, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "しれっと教育ママが\n生まれてる…？", 80005, 106001, 25, "キャル", 0, 7, 0, 418, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 80005, 105801, 23, "ペコリーヌ", 0, 7, 0, 419, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "え～～～～！？", 80005, 106001, 26, "キャル", 0, 7, 0, 420, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 80005, 106001, 27, "キャル", 0, 8, 0, 421, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 80005, 106401, 19, "シェフィ", 0, 8, 0, 422, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 80005, 105901, 18, "コッコロ", 0, 8, 0, 423, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 80005, 105801, 24, "ペコリーヌ", 0, 8, 0, 424, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 80005, 106401, 20, "シェフィ", 0, 8, 0, 425, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 80005, 106001, 28, "キャル", 0, 8, 0, 426, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 80005, 105901, 19, "コッコロ", 0, 8, 0, 427, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 80005, 106401, 21, "シェフィ", 0, 8, 0, 428, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 80005, 106001, 29, "キャル", 0, 8, 0, 429, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 80005, 106001, 30, "キャル", 0, 8, 0, 430, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 80005, 105801, 25, "ペコリーヌ", 0, 8, 0, 431, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 80005, 106001, 31, "キャル", 0, 8, 0, 432, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 80005, 106401, 22, "シェフィ", 0, 9, 0, 433, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 80005, 106401, 23, "シェフィ", 0, 9, 0, 434, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 80005, 106401, 24, "シェフィ", 0, 9, 0, 435, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 80005, 106401, 25, "シェフィ", 0, 9, 0, 436, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 80005, 106401, 26, "シェフィ", 0, 9, 0, 437, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それから、それから…！\nぅ、ぅぅっ…！", 80005, 106401, 27, "シェフィ", 0, 9, 0, 438, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "―びえぇぇ～んっ！！！", 80005, 106401, 28, "シェフィ", 0, 9, 0, 439, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "どうされましたか、シェフィさま", 80005, 105901, 20, "コッコロ", 0, 9, 0, 440, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ううっ…ひっく…\nママッ…！", 80005, 106401, 29, "シェフィ", 0, 9, 0, 441, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 80005, 105901, 21, "コッコロ", 0, 9, 0, 442, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 80005, 105901, 22, "コッコロ", 0, 9, 0, 443, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 80005, 106401, 30, "シェフィ", 0, 9, 0, 444, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "主さま\n3.5周年まであと５日\nでございます", 80005, 105901, 23, "コッコロ", 0, 10, 0, 445, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ですがその前に\n生放送がありますね", 80005, 105901, 24, "コッコロ", 0, 10, 0, 446, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…生放送に向けた\n意気込みでございますか？", 80005, 105901, 25, "コッコロ", 0, 10, 0, 447, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 80005, 105901, 26, "コッコロ", 0, 10, 0, 448, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 80005, 105901, 27, "コッコロ", 0, 10, 0, 449, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 80005, 105901, 28, "コッコロ", 0, 10, 0, 450, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 80005, 105901, 29, "コッコロ", 0, 10, 0, 451, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 80005, 105901, 30, "コッコロ", 0, 10, 0, 452, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 80005, 105901, 31, "コッコロ", 0, 10, 0, 453, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "3.5周年まであと４日！\nやばいですね☆", 80005, 105801, 26, "ペコリーヌ", 0, 11, 0, 454, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 80005, 106001, 32, "キャル", 0, 11, 0, 455, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 80005, 105801, 27, "ペコリーヌ", 0, 11, 0, 456, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 80005, 105801, 28, "ペコリーヌ", 0, 11, 0, 457, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 80005, 105801, 29, "ペコリーヌ", 0, 11, 0, 458, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 80005, 106001, 33, "キャル", 0, 11, 0, 459, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 80005, 105801, 30, "ペコリーヌ", 0, 11, 0, 460, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 80005, 105801, 31, "ペコリーヌ", 0, 11, 0, 461, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 80005, 105801, 32, "ペコリーヌ", 0, 11, 0, 462, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "だからあたしはやるなんて一言も…", 80005, 106001, 34, "キャル", 0, 11, 0, 463, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "オイッスー☆", 80005, 105801, 33, "ペコリーヌ", 0, 11, 0, 464, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "聞きなさいっての！！", 80005, 106001, 35, "キャル", 0, 11, 0, 465, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "3.5周年まであと３日…\nそして生放送は、明日…", 80005, 106401, 31, "シェフィ", 0, 12, 0, 466, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 80005, 106401, 32, "シェフィ", 0, 12, 0, 467, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "おいっす！\n…こうじゃなかったわね\nええと確か…", 80005, 106401, 33, "シェフィ", 0, 12, 0, 468, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 80005, 106401, 34, "シェフィ", 0, 12, 0, 469, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 80005, 106401, 35, "シェフィ", 0, 12, 0, 470, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "やってますねシェフィちゃん！", 80005, 105801, 34, "ペコリーヌ", 0, 12, 0, 471, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "なによ、考えることは\nみんな同じってこと？", 80005, 106001, 36, "キャル", 0, 12, 0, 472, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 80005, 105901, 32, "コッコロ", 0, 12, 0, 473, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "みんな…もちろんよ！", 80005, 106401, 36, "シェフィ", 0, 12, 0, 474, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 80005, 105801, 35, "ペコリーヌ", 0, 12, 0, 475, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 80005, 190801, 7, "カリン", 0, 13, 0, 476, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 80005, 190801, 8, "カリン", 0, 13, 0, 477, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 80005, 105801, 36, "ペコリーヌ", 0, 13, 0, 478, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 80005, 190801, 9, "カリン", 0, 13, 0, 479, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 80005, 105901, 33, "コッコロ", 0, 13, 0, 480, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 80005, 190801, 10, "カリン", 0, 13, 0, 481, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "大丈夫…大丈夫…\nあたしは大丈夫…", 80005, 106001, 37, "キャル", 0, 13, 0, 482, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 80005, 190801, 11, "カリン", 0, 13, 0, 483, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "あうー？", 80005, 106401, 37, "シェフィ", 0, 13, 0, 484, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 4, "あ…", 80005, 105801, 37, "みんな", 0, 13, 0, 485, "105901,34,106001,38,190801,12");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 80005, 106001, 39, "キャル", 0, 13, 0, 486, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 80005, 105901, 35, "コッコロ", 0, 13, 0, 487, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 80005, 105801, 38, "ペコリーヌ", 0, 13, 0, 488, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 80005, 190801, 13, "カリン", 0, 13, 0, 489, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 80005, 106401, 38, "シェフィ", 0, 14, 0, 490, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 80005, 105801, 39, "ペコリーヌ", 0, 14, 0, 491, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 80005, 106001, 40, "キャル", 0, 14, 0, 492, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 80005, 105901, 36, "コッコロ", 0, 14, 0, 493, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 80005, 106401, 39, "シェフィ", 0, 14, 0, 494, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 80005, 105801, 40, "ペコリーヌ", 0, 14, 0, 495, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 80005, 105901, 37, "コッコロ", 0, 14, 0, 496, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 80005, 106001, 41, "キャル", 0, 14, 0, 497, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "へ、へぇ…", 80005, 106401, 40, "シェフィ", 0, 14, 0, 498, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 80005, 105801, 41, "ペコリーヌ", 0, 14, 0, 499, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 80005, 106401, 41, "シェフィ", 0, 14, 0, 500, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 80005, 106401, 42, "シェフィ", 0, 14, 0, 501, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 80005, 105801, 42, "ペコリーヌ", 0, 15, 0, 502, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "祝！", 80005, 106001, 42, "キャル", 0, 15, 0, 503, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "3.5周年！", 80005, 105901, 38, "コッコロ", 0, 15, 0, 504, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "おめでとうございます！", 80005, 106401, 43, "シェフィ", 0, 15, 0, 505, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 80005, 190801, 14, "カリン", 0, 15, 0, 506, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 80005, 190801, 15, "カリン", 0, 15, 0, 507, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 80005, 105801, 43, "ペコリーヌ", 0, 15, 0, 508, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 80005, 105801, 44, "ペコリーヌ", 0, 15, 0, 509, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 80005, 106001, 43, "キャル", 0, 15, 0, 510, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 80005, 106001, 44, "キャル", 0, 15, 0, 511, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 80005, 106401, 44, "シェフィ", 0, 15, 0, 512, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 80005, 106401, 45, "シェフィ", 0, 15, 0, 513, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 80005, 105901, 39, "コッコロ", 0, 15, 0, 514, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 80005, 105901, 40, "コッコロ", 0, 15, 0, 515, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 4, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 80005, 105901, 41, "コッコロ", 0, 15, 0, 516, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 80005, 105801, 45, "ペコリーヌ", 0, 15, 0, 517, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 4, "これからも\nよろしくおねがいします！", 80005, 105801, 46, "みんな", 0, 15, 0, 518, "105901,42,106001,45,106401,46,190801,16");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60003, 190804, 1, "カリン", 0, 0, 1, 519, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60003, 0, 0, "", 1, 0, 1, 520, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60003, 0, 0, "", 1, 0, 1, 521, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 60003, 0, 0, "", 1, 0, 1, 522, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 60003, 0, 0, "", 1, 0, 1, 523, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60003, 0, 0, "", 1, 0, 2, 524, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60003, 0, 0, "", 2, 0, 1, 525, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60003, 0, 0, "", 2, 0, 1, 526, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 60003, 0, 0, "", 2, 0, 1, 527, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 60003, 0, 0, "", 2, 0, 1, 528, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60003, 0, 0, "", 2, 0, 2, 529, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60003, 0, 0, "", 3, 0, 1, 530, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60003, 0, 0, "", 3, 0, 1, 531, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60003, 0, 0, "", 3, 0, 1, 532, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60003, 0, 0, "", 3, 0, 1, 533, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 60003, 0, 0, "", 3, 0, 1, 534, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60003, 0, 0, "", 3, 0, 1, 535, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 60003, 0, 0, "", 3, 0, 2, 536, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60003, 0, 0, "", 4, 0, 1, 537, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 60003, 0, 0, "", 4, 0, 1, 538, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 60003, 0, 0, "", 4, 0, 1, 539, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 60003, 0, 0, "", 4, 0, 1, 540, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60003, 0, 0, "", 4, 0, 1, 541, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 60003, 0, 0, "", 4, 0, 1, 542, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 60003, 0, 0, "", 4, 0, 2, 543, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60003, 190804, 2, "カリン", 0, 0, 0, 544, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60003, 190804, 3, "カリン", 0, 7, 0, 545, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60004, 190804, 1, "カリン", 0, 0, 1, 546, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60004, 0, 0, "", 1, 0, 1, 547, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 60004, 0, 0, "", 1, 0, 1, 548, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 60004, 0, 0, "", 1, 0, 1, 549, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 60004, 0, 0, "", 1, 0, 1, 550, "");
